  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `question_type_id` bigint(20) DEFAULT NULL,
  `question_category_id` bigint(20) DEFAULT NULL,
  `question_para1` text,
  `question_para2` text,
  `answer_ids` text,
  `right_answer_ids` text,
  `answer_text` text,
