insert  into `question_paper`(`id`,`paper_title`,`course_name`,`instructions`,`total_time_in_secs`,`author_id`) values (34,'Paper 1','UPSC 2018',':head:INSTRUCTION FOR ST (SBI CLK-PRE):head:|:subhead:Please read the following instructions very carefully::subhead:|:li:Read carefully the instructions before starting the test.you can read the instructions in between the exam after clicking the \"INSTRUCTION BUTTON\".:li:|:li:You have 60 minutes (20 minutes for English Language, 20 minutes for Numerical Ability and 20 minutes for Reasoning Ability) to complete the test.:li:|:li:The test contains a total of 100 questions.:li:|:li:There is only one correct answer to each question. Click on the most appropriate option to mark it as your answer.:li:|:li:You will be awarded 1 marks for each correct answer.:li:|:li:There is 0.25 negative marks for each wrong answer.:li:|:li:According to your selection of questions it will change the colour in the boxes at the right side window, these colours will help you to identify the required group of questions.:li:|:li:You can unmark your answer by clicking on the \"CLEAR RESPONSE\" Option.:li:|:li:You can mark a question for reviewing it later by clicking on the “marked & review” button.:li:|:li:You can use the \"FILTER BUTTON\" to select your choices individually according to your given answers.:li:|:li:A Number list of all questions appears at the right hand side of the window. You can access the questions in any order within a section or across sections by clicking on the question number given on the number list.:li:|:li:You can use rough sheets while taking the test. Do not use calculators, log tables, dictionaries, or any other printed/online reference material during the test.:li:|:li:Do not click the button “SUBMIT TEST” before completing the test. A test once submitted cannot be resumed.:li:|:li: If your system gets hanged or you face any other problem in internet connectivity, - \"Don\'t Worry, Kindly close the window of the Te